import React from "react";
import "./Nav.css";

function Nav() {
  return (
    <div className="nav">
      <h2>Recommended</h2>
      <h2>Trending</h2>
      <h2>Top Rated</h2>
      <h2>Action</h2>
      <h2>Comedy</h2>
      <h2>Horror</h2>
      <h2>Thriller</h2>
      <h2>Animation</h2>
      <h2></h2>
    </div>
  );
}

export default Nav;
